import React,{Component} from 'react';
import './App.css';

class App extends Component {
  render(){
    const divStyle = {
      'textAlign' : 'center',
    }
    return(
        <div>
        <div style={divStyle}>
          <h1 style={{color:'blue'}}>hello world</h1>
        </div>
        <p>hello</p>
        </div>
    )

  }
}

export default App;
